#include <vector>
#include <unordered_map>
#include <cmath>

using namespace std;

class Solution {
public:
    long long maximumSum(vector<int>& nums) {
        unordered_map<int, long long> groupSum;
        for (int num : nums) {
            int mask = 0;
            for (int i = 2; i <= sqrt(num); ++i) {
                int count = 0;
                while (num % i == 0) {
                    num /= i;
                    count++;
                }
                if (count % 2 == 1) mask ^= (1 << i);
            }
            if (num > 1) mask ^= (1 << num);
            groupSum[mask] += num;
        }

        long long maxSum = 0;
        for (auto& [mask, sum] : groupSum) {
            maxSum = max(maxSum, sum);
        }
        return maxSum;
    }
};
